import React from 'react'

function CityInfo(props){
	const store = props.store;
	return (
		<div className="cityInfo dropdown">
			<button className="dropdown-toggle " data-toggle="dropdown" type="button">
				<span className="cityName"> {store.name} </span>
				<img 
					src={store.icon} alt="icon" className="icon"
				/> 
				<span style={{fontSize: '1.2em'}}>
	            	{store.temp}&deg;
	            </span>
            </button>
            <ul className="dropdown-menu" style={{textAlign: 'center'}}>
            	<li>Hola</li>
			    <li>que</li>
			    <li>tal</li>
			    <li></li>
			    <li></li>
            </ul>
		</div>
	);
}

export default CityInfo;
